description:
Blessed are the poor in spirit: for theirs is the kingdom of heaven. Matthew 5:3.  
The season of distress and anguish before us will require a faith that can endure weariness, delay, and hunger--a faith that will not faint though severely tried. The period of probation is granted to all to prepare for that time.  {GC 621.2} 
The time of trouble, such as never was, is soon to open upon us; and we shall need an experience which we do not now possess and which many are too indolent to obtain. It is often the case that trouble is greater in anticipation than in reality; but this is not true of the crisis before us. The most vivid presentation cannot reach the magnitude of the ordeal."  {GC 622.4}
